import React, { Component } from 'react';

class Home extends Component {
    render() {
        return (
            <div>
                <h2>Đây là trang chủ</h2>
                <h4>Sẽ hiện thông tin thi cử, danh sách phòng thi, tuyển sinh trên này</h4>
            </div>
        );
    }
}

export default Home;
